def square_root(num):
    if num <= 2:
        return num
    left = 0
    right = num
    while left <= right:
        mid = (left + right) // 2
        square = mid * mid
        if square == num:
            return mid
        elif square < num:
            left = mid + 1
        else:
            right = mid - 1
    return round((left + right) / 2)

